import React from 'react';
import './Skills.css';

const Skills = () => (
  <section id="skills">
    <h2>Skills</h2>
    <ul>
      <li>Skill 1</li>
      <li>Skill 2</li>
      {/* Add more skills as needed */}
    </ul>
  </section>
);

